"use strict";

const _ = require("underscore");
let fieldTypes = {};

//let availableFieldTypes = ['checkbox', 'datetime', 'group', 'file', 'html', 'image', 'input', 'select', 'number', 'switch', 'textarea', 'raw', 'reference'];
let availableFieldTypes = ['checkbox'];

let init = () => {
    _.each(availableFieldTypes, field => {
        fieldTypes[field] = require(`./fields/${field}`);
    });
}

exports.init = init;